import React, { useState } from 'react'
import "./styles.css";
import 'font-awesome/css/font-awesome.min.css';

const Category = () => {

  return (
    <div className='container mt-3'>
      <button className="btn btn-primary" type="button" data-bs-toggle="offcanvas" data-bs-target="#offcanvasRight" aria-controls="offcanvasRight">Category</button>

      <div className="offcanvas offcanvas-end" tabindex="-1" id="offcanvasRight" aria-labelledby="offcanvasRightLabel">
        <div className="offcanvas-header">
          <h5 className="offcanvas-title" id="offcanvasRightLabel">Offcanvas right</h5>
          <button type="button" className="btn-close" data-bs-dismiss="offcanvas" aria-label="Close"></button>
        </div>
        <div className="offcanvas-body">
          <button type="button" className="btn btn-light">
        Chinese <i className="fa-solid fa-ellipsis-vertical mx-2"></i>
      </button>
        </div>
      </div>    
    </div>
  );
};

export default Category
